CREATE VIEW npm_count.missing_download_dates AS
 WITH RECURSIVE date_series AS (
         SELECT p.package_name,
            p.creation_date AS start_date,
            COALESCE(p.last_fetched_date, CURRENT_DATE) AS end_date
           FROM npm_count.npm_package p
          WHERE (p.is_active = true)
        ), all_dates AS (
         SELECT date_series.package_name,
            date_series.start_date AS date
           FROM date_series
        UNION ALL
         SELECT a_1.package_name,
            ((a_1.date + '1 day'::interval))::date AS date
           FROM all_dates a_1
          WHERE (a_1.date < ( SELECT d_1.end_date
                   FROM date_series d_1
                  WHERE (d_1.package_name = a_1.package_name)))
        )
 SELECT a.package_name,
    a.date AS missing_date
   FROM (all_dates a
     LEFT JOIN npm_count.daily_downloads d ON (((a.package_name = d.package_name) AND (a.date = d.date))))
  WHERE ((d.package_name IS NULL) AND (a.date <= CURRENT_DATE));


